sprites.onOverlap(SpriteKind.C3, SpriteKind.close, function (sprite, otherSprite) {
    if (close_window) {
        if (controller.A.isPressed()) {
            sprites.destroy(close_window)
            sprites.destroy(my_arcade_window)
            sprites.destroy(dowloads)
            cursor.setKind(SpriteKind.Player)
        } else if (road_rageexe) {
            sprites.destroy(road_rageexe)
            sprites.destroy(runexe)
            sprites.destroy(virus2)
            cursor.setKind(SpriteKind.Player)
        }
    }
})
